import React from "react"
import "./styles.css"

export class List extends React.Component {
    constructor(){
        super()
        console.log("Ik ben een list")
        this.state = {
            subtitle: "Available games",
            games:[]
        }
        this.loadGames()
    }

    loadGames(){
        // fetch("https://pokeapi.co/api/v2/pokemon")
        fetch("http://145.24.222.27:8000/games/")
            .then((response) => response.json())
            .then((data) => this.gamesLoaded(data))
            .catch((error) => console.log(error))
    }

    gamesLoaded(data){
        console.log("Games loaded!")
        console.log(data.items)
        this.setState({
            games:data.items
        })
    }

    //JSX
    render(){
        const allGames = this.state.games.map((game, index) => (
            <div key={index}>{game.name}</div>
        ))
        return(
            <div className="list">
                <h4>{this.props.title}</h4>
                <p>Aantal games: {this.state.games.length}</p>
                <div>{allGames}</div>
            </div>
        )
    }
}
